import React, { useState, useEffect } from 'react';
import CarouselImages from './Carouselimages';

function CarouselImage() {
    const [headlines, setHeadlines] = useState([]);
    useEffect(() => {
        fetch("https://newsapi.org/v2/top-headlines?country=us&apiKey=bb5b1c906cb34c1d90fe13b072449dee").then(res => {
            console.log('called')
            return res.json()
            console.log('called')
        }).then(ans => {
            const comp = ans.articles.map((item, index) => {
                if (index === 0)
                    return <CarouselImages key={index} active={true} heading={item.title} imageUrl={item.urlToImage} />
                return <CarouselImages key={index} heading={item.title} imageUrl={item.urlToImage} />
            })
            setHeadlines(comp)
        }).catch(err => {
            throw err
        })
    }, [])
    return (
        <div class="carousel-inner">
            {headlines}
        </div >
    )
}

export default CarouselImage;
